import React from 'react'

class App extends React.App{
  constructor(props){
    super(props);
    this.state = {
      dinos: []
    }
  }


  componentDidMount(){
    const url = "http://127.0.0.1:8000/api/dinos/";
    fetch(url)
    .then(res => res.json())
    .then(data => this.setState({shoes: data}));
  }

}

export default App;
